import React from "react";
import marketingCase from "../assets/marketingCase.png";

function Pagefive() {
  return (
    <div
      style={{ display: "flex", alignItems: "center", flexDirection: "column" }}
    >
      <p>Our Works</p>
      <h3>Our Case Studies</h3>

      <div>
        <div>
            <img/>
            <p>Email Marketing</p>
            <p>Fashion, Product</p>
        </div>
      </div>
    </div>
  );
}

export default Pagefive;
